  "name": "Controlled Attack",
	"type": "Battle",
	"description": "With +500 of brain, you will lose 'Attack' command, but get instead the specific attacks enabled for your digimon. In other words, you gain control of your Digimon's attacks. The regular attack button disappears and you are given three new ones in its place.  Each one may have a different symbol on it, but they are the attacks that you have set.  You may choose to tell your Digimon to only attack with that one attack by selecting it. If you are not happy with this, then return to 'Your Call' and your Digimon will alternate attacks."
}

{
